package com.alg.list.slidingWindow;

public class LongestContinuousSubstring {
    public int longestContinuousSubstring(String s) {
        //Sliding windows
        if(s.length() <=1) return s.length();
        int max = 1;

        int i = 0, j = 1;
        int count = 1;
        while(j < s.length()) {
            //System.out.print("i:" + i + " j:" + j + "; ");
            //Well, mxtherfxcking leetcode decided to ask for 'adjacent & rising' alphabetic order,
            // rather than increasing order alone like s.charAt(j) >= s.charAt(j - 1)
            if(s.charAt(j) - s.charAt(j - 1) == 1) {
                count++;
                //System.out.println("count increase:" + count);
                max = Math.max(count, max);
            } else {
                //System.out.println("Count reset;");
                count = 1;
                i = j;
            }
            ++j;
        }
        return max;
    }

    public static void main(String[] args) {
        LongestContinuousSubstring sol = new LongestContinuousSubstring();
        String s = "";
        System.out.println(sol.longestContinuousSubstring(s));
    }
}
